ctNode();\n            N=AddNewContact(List,NewContact,N);\n            printf(\"You just add the contact: \\n\");\n            printf(\"%20s%20s%30s%12s%30s%30s %9s\\n\",\"FirstName\",\"LastName\",\"Company\",\"PhoneNumber\",\"Working Address\",\"Home Address\",\"Birthday\");\n            PrintNode(NewContact);\n            break;\n        case \'2\':\n            EditContact(List,N);\n            break;\n        case \'3\':\n            N=DeleteContact(List,N);\n            break;\n        case \'4\':\n            SearchContact(List,N);\n            break;\n        case \'5\':\n            ChucNang5(List,N);\n            break;\n        case \'6\':\n            ChucNang6(List,N);\n            break;\n        case \'7\':\n            break;      \n        default:\n            break;\n        }\n\n    } while(choice != \'7\');\n    return 0;\n}'),('Branch03','master','Repo03','Hung\nNGUYEN\nSun\n0372700185\nTran Dai Nghia\nHa Dong\n17/ 1/2002\nKhanh\nNguyen\nFPT\n0373700176\nHoa Lac\nThai Binh\n22/ 5/2002'),('Branch04','img_user','Repo03','anhDev.png'),('Branch05','master','Repo04','git.txt\nlol.txt\nreadme.txt'),('Branch06','main','Repo04','danhba.txt'),('Branch07','add_game.txt','Repo04','game.txt'),('Branch08','master','Repo05','.gitignore\nGemfile\nGemfile.lock\nProcfile\nReadme.md\n_config.yml\nindex.html\nposts.html'),('Branch09','master','Repo06','.idea\nInitialize commit\n7 years ago\n__pycache__\nInitialize commit\n7 years ago\napi\nInitialize commit\n7 years ago\njquery6\nInitialize commit\n7 years ago\nstatic\nInitialize commit\n7 years ago\ntemplates\nInitialize commit\n7 years ago\nREADME.md\nCreate README.md\n7 years ago\ndb.sqlite3\nInitialize commit\n7 years ago\nmanage.py'),('Branch10','master','Repo07','iweather.xcodeproj\niweather\n.gitignore\nREADME.md'),('Branch11','main','Repo07','Assets.xcassets/AppIcon.appiconset\nBase.lproj\nAppDelegate.swift\nInfo.plist\nViewController.swift'),('Branch12','master','Repo08','Math.xcodeproj\nMath'),('Branch1